import React from 'react';
import logo from './logo.svg';
import './App.css';
import {BrowserRouter,
Routes,
  Route,
} from "react-router-dom";
import { Dashboard } from './dashboard/dashboard';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/emp" element={<Dashboard/>}/>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
